EXHIBIT 1, copies of social media printouts, marked.
The defendant is sentenced to the Wisconsin State Prison System for a total of seven (7) years.  That is three (3) years initial confinement followed by four (4) years extended supervision.
The Court finds the defendant eligible for the Substance Abuse Program.  He is not eligible for the Challenge Incarceration Program.
Condition of extended supervision:
1) Defendant must register as a sexual offender and comply with sex offender treatment;
2) No use of possession of any internet enabled devices, including cellphones, unless approved by the agent;
3) Maintain absolute sobriety;
4) Maintain fulltime employment, schooling or combination;
5) No contact with any children under the age of 18, unless approved by the agent, except his own biological children;
6) No contact with the victim;
7) Pay $100.00 restitution to James Logan at 1723 New York Avenue, Manitowoc, WI;
8) Pay court costs;
9) pay supervision fees in an amount to be determined by DOC;
10) defendant must register all current and past online and/or social media accounts including user names and passwords with agent;
11)  assessment, treatment, counseling as deemed appropriate by the Departments assessment process.
Minutes.
